import React from 'react';
import { Link } from 'react-router-dom'; // Importa Link desde react-router-dom

const Navbar = () => {
  return (
    <div>
      <nav className="navbar navbar-expand-lg bg-body-tertiary">
        <div className="container-fluid">
          <img src="images/logoTerraNova.png" style={{ width: "100%", maxWidth: "80px" }} className="navbar-brand" alt="Logo de Hotel Terra Nova" />
          <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarScroll" aria-controls="navbarScroll" aria-expanded="false" aria-label="Toggle navigation">
            <span className="navbar-toggler-icon"></span>
          </button>
          <div className="collapse navbar-collapse" id="navbarScroll">
            <ul className="navbar-nav me-auto my-2 my-lg-0 navbar-nav-scroll" style={{ "--bs-scroll-height": "100px" }}>
              <li className="nav-item">
                <Link className="nav-link active" aria-current="page" to="/">Inicio</Link> {/* Usamos Link en lugar de <a> */}
              </li>
              <li className="nav-item">
                <Link className="nav-link" to="/reservar">Reservar</Link> {/* Usamos Link en lugar de <a> */}
              </li>
              <li className="nav-item">
                <Link className="nav-link" to="/nosotros">Nosotros</Link> {/* Usamos Link en lugar de <a> */}
              </li>
              <li className="nav-item">
                <Link className="nav-link" to="/contacto">Cont√°ctanos</Link> {/* Usamos Link en lugar de <a> */}
              </li>
            </ul>
            <ul className="navbar-nav ms-auto">
              <li className="nav-item">
                <Link className="nav-link admin-link" to="/login">Administrador</Link> {/* Usamos Link en lugar de <a> */}
              </li>
            </ul>
            <form className="d-flex" role="search">
              <input className="form-control me-2" type="search" placeholder="Buscar" aria-label="Search" />
              <button className="btn btn-primary" type="submit">Buscar</button>
            </form>
          </div>
        </div>
      </nav>
    </div>
  );
};

export default Navbar;
